"""
Given a sequence of n integers a1, a2, ..., an, a 132 pattern is a subsequence ai, aj, ak such
that i j k and ai k j. Design an algorithm that takes a list of n numbers as input and checks whether there is a 132 pattern in the list.

Note: n will be less than 15,000.

Example 1:

Input: [1, 2, 3, 4]

Output: False

Explanation: There is no 132 pattern in the sequence.

Example 2:

Input: [3, 1, 4, 2]

Output: True

Explanation: There is a 132 pattern in the sequence: [1, 4, 2].

Example 3:

Input: [-1, 3, 2, 0]

Output: True

Explanation: There are three 132 patterns in the sequence: [-1, 3, 2], [-1, 3, 0] and [-1, 2, 0].
"""
import sys
from typing import List
import pytest


class Solution:
    def find132pattern(self, nums: List[int]) -> bool:
        if len(nums) < 3:
            return False

        min_from_left = [nums[0]]
        for i in range(1, len(nums)):
            min_from_left.append(min(min_from_left[-1], nums[i]))

        stack = [nums[-1]]
        for i in range(len(nums) - 2, 0, -1):
            if stack and nums[i] > stack[-1]:
                while stack:
                    n = stack.pop()
                    if min_from_left[i] < n < nums[i]:
                        return True
                    if not stack or stack[-1] > nums[i]:
                        break
            if not stack or nums[i] < stack[-1]:
                stack.append(nums[i])
        return False


